declare var process : {
  env: {
    REACT_APP_REMITANO_BACKEND_URL: string
  }
}

type useLoadVideosProps = {
  pageIndex: number;

}

const useLoadVideos = (pageIndex: useLoadVideosProps) => {
  fetch(`${process.env.REACT_APP_REMITANO_BACKEND_URL}/videos`)
    .then((response) => {
      console.log(response);
    })
  return null
}

export default useLoadVideos
